    data: |
      SELECT - col0 * - ( - col2 ) + - ( col0 + - col0 ) * - ( tab0.col2 ) AS col0 FROM tab0 (FORMAT parquet);
  - name: tab0

outputs:
  - name: q10635.out
    data: |
      -35
      -7298
      -792
